import axios from 'axios'
import React, { useEffect, useState } from 'react'
import "./ConsultantStyles.css"

export default function DashboardConsultantDetails() {
    const [consultant, setconsultant] = useState("")
    const [consultantId, setconsultantId] = useState("")
    const [consultantRequests, setconsultantRequests] = useState([])

    const [seconds, setSeconds] = useState(0);
    const [pageRefresh, setpageRefresh] = useState(0)

    useEffect(() => {
        const user = {
            "email": localStorage.getItem("user")
        }
        const interval = setInterval(() => {
            axios.post('http://localhost:8080/findconsult', user)
                .then(res => {
                    setconsultant(res)
                    setconsultantId({ consultantID: res.data[0]._id })
                    // console.log(consultantId)
                })
            axios.post('http://localhost:8080/findconsultantrequests', consultantId)
                .then(res => {
                    const data = res.data
                    setconsultantRequests([...data])
                    console.log(consultantRequests)
                })
            setSeconds(seconds => seconds + 1);
        }, 1000);
        return () => clearInterval(interval);

        // eslint-disable-next-line react-hooks/exhaustive-deps
    }, [pageRefresh, consultantId])

    function displayconsultantrequests() {
        if (consultantRequests.length === 0) {
            return (
                <h1>No Requests To work ON</h1>
            )
        } else {
            return (
                /*
                

                */
                <table id="customers">
                    <tbody>
                        <tr>
                            <th>User</th>
                            <th>Topic</th>
                            <th>Urgency</th>
                            <th>Description</th>
                            <th>Date</th>
                            <th>Upload Report</th>
                            <th>Action</th>
                        </tr>
                        <tr>
                            {}
                            <td>5</td>
                            <td>John Doe</td>
                            <td>Some Topic</td>
                            <td>Some Content</td>
                            <td>Date</td>

                            <td>
                                <input type="file" id="myFile" name="filename" />
                            </td>

                            <td>
                                <button onClick={nothing} className="btn btn-primary">Post</button>
                            </td>

                        </tr>
                    </tbody>
                </table>
            )
        }
    }


    function nothing() {
        console.log('hi')
    }
    return (

        <div className="cprofile">
            <h1>Hello from Consultant DashBoard</h1>
            {/*Received Here*/}
            <div className="myDiv">
                <br />
                <br />
                <h1>Requests Received</h1>
                {displayconsultantrequests()}
                <br />
                <br />
            </div>

            <br></br>

            {/*Responds  Here*/}
            <div className="myDiv">
                <br />
                <br />
                <h1>Completed</h1>
                <table id="customers">
                    <tbody>
                        <tr>
                            <th>Number</th>
                            <th>User</th>
                            <th>Topic</th>
                            <th>Content</th>
                            <th>Date</th>
                        </tr>
                        <tr>
                            <td>03</td>
                            <td>John Doe</td>
                            <td>Some Topic</td>
                            <td>Some Content</td>
                            <td>Date</td>
                        </tr>
                    </tbody>
                </table>
                <br />
                <br />
            </div>

        </div>
    )
}
